import React from "react";
import DoctorMenu from "../components/layout/DoctorMenu";

const PrivacyPolicy = () => {
  return (
    <DoctorMenu>
      <h1>Privacy Policy</h1>
      <p>
        This Privacy Policy outlines how Doctorâ€™s App we collects, uses, and
        safeguards your personal information when you use our mobile application
        ("App"). By using the App, you agree to the terms described in this
        Privacy Policy.
      </p>
      <h4>Information We Collect:</h4>
      <p>
        <ol>
          <li>
            <span> Personal Information:</span> We may collect certain
            personally identifiable information, such as your name, email
            address, phone number, and location when you place an order, sign up
            for an account, or interact with the App.
          </li>{" "}
          <li>
            <span>Order Details:</span> When you place an order through the App,
            we collect information related to your order, including the items
            ordered, payment details, and delivery address.
          </li>{" "}
          <li>
            <span>Device Information:</span> We may automatically collect
            information about your device, including its model, operating
            system, and unique device identifier.
          </li>{" "}
          <li>
            <span> Location Information:</span> With your permission, we may
            collect your precise location data to provide you with
            location-based services, such as finding the nearest food truck.
          </li>{" "}
        </ol>
      </p>
    </DoctorMenu>
  );
};

export default PrivacyPolicy;
